xt-align: center;\">Please keep this information in a safe place.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Login to your account with your username and password by clicking <a href=\"https://app.realfundingprogram.com/\">here</a> to access your control panel for your performance dashboard</span></p>',NULL,'2022-09-24 12:30:18','2023-06-20 10:27:46',NULL,1,1),
