(13625,15,'App\\Mail\\PerformancePassedMail','Performance Passed','<h2>Challenge is passed!</h2>\n<p>Plan <strong>\"{{plan_title}}\" </strong></p>\n<p>Account: <strong>\"{{account_number}}\"</strong></p>\n<p>&nbsp;</p>\n<h3 style=\"text-align: left;\">Trading Objectives</h3>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>Max Loss: ({{target_max_loss}}): <strong>{{stat_max_loss}}</strong></li>\n<li>Max Daily Loss ({{target_max_daily_loss}}): <strong>{{stat_max_daily_loss}}</strong></li>\n<li>Profit ({{target_profit}}): <strong>{{stat_profit}}</strong></li>\n<li>Min Trading Days: <strong>{{target_min_trading_days}}</strong>,</li>\n<li>Max Trading Days: <strong>{{target_max_trading_days}})</strong></li>\n<li>Your Trading Days: <strong>{{stat_trading_days}}</strong></li>\n</ul>\n</li>\n</ul>\n<p>&nbsp;</p>',NULL,'2023-11-22 12:08:12','2023-11-22 12:08:12',NULL,0,NULL),
(13630,15,'App\\Mail\\PerformanceRejectedMail','Performance Rejected','<h2>Rejected!</h2>\n<p>One or more of your objectives have been failed.</p>\n<p>Plan <strong>\"{{plan_title}}\" </strong></p>\n<p>Account: <strong>\"{{account_number}}\"</strong></p>\n<p> </p>\n<h3 style=\"text-align: left;\">Trading Objectives</h3>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>Max Loss: ({{target_max_loss}}): <strong>{{stat_max_loss}}</strong></li>\n<li>Max Daily Loss ({{target_max_daily_loss}}): <strong>{{stat_max_daily_loss}}</strong></li>\n<li>Profit ({{target_profit}}): <strong>{{stat_profit}}</strong></li>\n<li>Min Trading Days: <strong>{{target_min_trading_days}}</strong>,</li>\n<li>Your Trading Days: <strong>{{stat_trading_days}}</strong></li>\n</ul>\n</li>\n</ul>',NULL,'2023-11-22 12:08:12','2023-11-22 12:08:12',NULL,0,NULL),
(13635,15,'App\\Mail\\TradingObjectiveFailedMail','Trading Objective Failed','<h3>Challenge Failed!</h3>\n<p style=\"text-align: left;\">Failed Objective: <strong>{{failed_objective}}</strong></p>\n<p style=\"text-align: left;\">Plan: <strong>\"{{plan_title}}\"</strong></p>\n<p style=\"text-align: left;\">Account: <strong>\"{{account_number}}\"</strong></p>\n<h3 style=\"text-align: left;\">Trading Objectives</h3>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>Max Loss: ({{target_max_loss}}): <strong>{{stat_max_loss}}</strong></li>\n<li>Max Daily Loss ({{target_max_daily_loss}}): <strong>{{stat_max_daily_loss}}</strong></li>\n<li>Profit ({{target_profit}}): <strong>{{stat_profit}}</strong></li>\n<li>Min Trading Days: <strong>{{target_min_trading_days}}</strong>,</li>\n<li>Max Trading Days: <strong>{{target_max_trading_days}})</strong></li>\n<li>Your Trading Days: <strong>{{stat_trading_days}}</strong></li>\n</ul>\n</li>\n</ul>',NULL,'2023-11-22 12:08:12','2023-11-22 12:08:12',NULL,0,NULL),
(13640,15,'App\\Mail\\UserActivatedMail','User Activated','<h3>Your account successfully activated.</h3>\n<p>You can login to the <a href=\"{{url}}\"><strong>Panel</strong></a> using your email \"<strong>{{login}}</strong>\".</p>',NULL,'2023-11-22 12:08:12','2023-11-22 12:08:12',NULL,0,NULL),
(13645,15,'App\\Mail\\UserActivationRequiredMail','User Activation Required','<h3><span style=\"font-size: 12pt;\">You need to activate your email before you can start using Panel.</span></h3>\n<p><span style=\"font-size: 12pt;\">Please use following link to activate account: <strong><a title=\"Activation Link\" href=\"{{link}}\">{{link}}</a></strong></span></p>',NULL,'2023-11-22 12:08:12','2023-11-22 12:08:12',NULL,0,NULL),
